import React from "react";
// import { BrowserRouter as Router, Route, Link } from "react-router-dom";


export default class TableShell extends React.Component {
    render() {
        return (
            <table>
                <thead>
                    <tr>
                        <td>First name</td>
                        <td>Last name</td>
                        <td>DOB</td>
                    </tr>
                </thead>

                <tbody>
                    {this.props.list}
                </tbody>
            </table>
        );
    }
}
